import React from "react";
import { Link } from "react-router-dom";

const MainNavigation = () => {
  return (
    <Header>
      <nav>
        <li>
          <Link to="/">Home</Link>
          <Link to="/dashboard">Dashboard</Link>
          <Link to="/contact">Contact</Link>
        </li>
      </nav>
      MainNavigation
    </Header>
  );
};

export default MainNavigation;
